import VueRouter from 'vue-router';
import LoginPage from "@/components/LoginPage";
import MyTemp from "@/components";




const routes =[
    {
        path:'/',
        name:'login',
        component:LoginPage
    } ,
    {
        path:'/MyTemp',
        name:'MyTemp',
        component:MyTemp
    }


    ]
const router =  new VueRouter({
    mode:'history',
    routes })

export  default router;
